rn policy?\\\", \\r\\n        \\\"acceptedAnswer\\\": { \\r\\n          \\\"@type\\\": \\\"Answer\\\", \\r\\n          \\\"text\\\": \\\"<p>Most unopened items in new condition and returned within <b>90 days</b> will receive a refund or exchange. Some items have a modified return policy noted on the receipt or packing slip. Items that are opened or damaged or do not have a receipt may be denied a refund or exchange. Items purchased online or in-store may be returned to any store.</p><p>Online purchases may be returned via a major parcel carrier. <a href=http://example.com/returns> Click here </a> to initiate a return.</p>\\\" \\r\\n        } \\r\\n      }, {\\r\\n        \\\"@type\\\": \\\"Question\\\", \\r\\n        \\\"name\\\": \\\"How long does it take to process a refund?\\\", \\r\\n        \\\"acceptedAnswer\\\": { \\r\\n          \\\"@type\\\": \\\"Answer\\\",\\r\\n          \\\"text\\\": \\\"We will reimburse you for returned items in the same way you paid for them. For example, any amounts deducted from a gift card will be credited back to a gift card. For returns by mail, once we receive your return, we will process it within 45 business days. It may take up to 7 days after we process the return to reflect in your account, depending on your financial institution\'s processing time.\\\" \\r\\n          }\\r\\n      }, { \\r\\n        \\\"@type\\\": \\\"Question\\\", \\r\\n        \\\"name\\\": \\\"What is the policy for late/non-delivery of items ordered online?\\\", \\r\\n        \\\"acceptedAnswer\\\": { \\r\\n          \\\"@type\\\": \\\"Answer\\\",\\r\\n          \\\"text\\\": \\\"<p>Our local teams work diligently to make sure that your order arrives on time, within our normal delivery hours of 9AM to 8PM in the recipient\'s time zone. During  busy holiday periods like Christmas, Valentine\'s and Mother\'s Day, we may extend our delivery hours before 9AM and after 8PM to ensure that all gifts are delivered on time. If for any reason your gift does not arrive on time, our dedicated Customer Service agents will do everything they can to help successfully resolve your issue.</p><p><a href=https://example.com/orders/>Click here</a> to complete the form with your order-related question(s).</p>\\\" \\r\\n        } \\r\\n      }, {\\r\\n        \\\"@type\\\": \\\"Question\\\",\\r\\n        \\\"name\\\": \\\"When will my credit card be charged?\\\", \\r\\n        \\\"acceptedAnswer\\\": { \\r\\n          \\\"@type\\\": \\\"Answer\\\",\\r\\n          \\\"text\\\": \\\"We\'ll attempt to securely charge your credit card at the point of purchase online. If there\'s a problem, you\'ll be notified on the spot and prompted to use another card. Once we receive verification of sufficient funds, your payment will be completed and transferred securely to us. Your account will be charged in 24 to 48 hours.\\\" \\r\\n        } \\r\\n      }, {\\r\\n        \\\"@type\\\": \\\"Question\\\",\\r\\n        \\\"name\\\": \\\"Will I be charged sales tax for online orders?\\\", \\r\\n        \\\"acceptedAnswer\\\": { \\r\\n          \\\"@type\\\": \\\"Answer\\\",\\r\\n          \\\"text\\\":\\\"Local and State sales tax will be collected if your recipient\'s mailing address is in: <ul><li>Arizona</li><li>California</li><li>Colorado</li></ul>\\\"} \\r\\n        }] \\r\\n    } \\r\\n    </script>\",\"language\":\"html\"},\"8bf03698-cf81-4521-8aa0-34d76609d295\":{\"value\":\"\",\"language\":\"javascript\"}}',	1,	'2024-08-28 14:47:30',	'2024-08-28 14:47:30',	'edace014-8742-41f9-8322-5b357978ccc8'),
