(5,	'Anchor',	'anchor',	'global',	NULL,	'Adds an anchor to the header so that a link can be added elsewhere on the page to jump to this section. The anchor must be URL friendly so you may only use alphanumeric characters, dashes and underscores. Reminder that the anchor must be UNIQUE per page, otherwise there will be conflicts. E.g. page-section\r\n\r\nIn the URL field to link to this section, you will enter the URL to the page (can be just the path without the domain) with \'#\' plus the string you provide. Example: \'/page-url#page-section\'.',	0,	'none',	NULL,	'imarc\\regexfield\\fields\\RegexField',	'{\"pattern\":\"^[a-zA-Z0-9_-]*$\",\"placeholderText\":\"my-anchor\"}',	'2024-08-15 17:00:57',	'2024-08-16 14:16:09',	NULL,	'a7b59ddf-b06d-4b04-8d73-c52609ae95d3'),
